  `created_by` int(10) unsigned NOT NULL,
  `updated_by` int(10) unsigned NOT NULL,
  `info` text,
  `short_info` tinytext,
  `rating` double NOT NULL DEFAULT '0',
  UNIQUE KEY `id` (`id`),
  KEY `spot_name_idx` (`name`),
  KEY `spot_region_id_idx` (`region_id`),
  CONSTRAINT `spots_regions_id_fk` FOREIGN KEY (`region_id`) REFERENCES `regions` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Районы';
